import React, { Component } from "react";
import {
  GoogleMap,
  LoadScript,
  DirectionsRenderer,
} from "@react-google-maps/api";
import "./Map.scss";

const containerStyle = {
  width: "100%",
  height: "350px",
};

const center = {
  lat: 43.64563,
  lng: -79.39545,
};

class Map extends Component {
  state = {
    response: null,
    travelMode: "DRIVING",
    origin: "",
    destination: "",
  };

  render() {
    return (
      <div className="Map">
        <LoadScript googleMapsApiKey="AIzaSyDZ4HxogFXeESTTN2JXpPpjCRozf7vEfIk">
          <GoogleMap
            mapContainerStyle={containerStyle}
            center={center}
            zoom={15}
          >
            {/* Child components, such as markers, info windows, etc. */}

            <></>
          </GoogleMap>
        </LoadScript>
      </div>
    );
  }
}

export default Map;
